INSERT INTO `movies` VALUES (1,'Avengers: Endgame','Sau sự kiện tàn khốc của Avengers: Infinity War, vũ trụ đã bị tàn phá bởi cú búng tay của Thanos.  Với sự giúp đỡ của các đồng minh còn lại, các Avengers phải tập hợp một lần nữa để hoàn tác hành động của Thanos và khôi phục trật tự cho vũ trụ.  Một hành trình xuyên thời gian đầy kịch tính sẽ quyết định số phận của toàn bộ vũ trụ.',181,'C13','Tiếng Anh','Phụ đề Tiếng Việt','Marvel Studios','2025-11-20','2026-01-20','NOW_SHOWING','https://www.themoviedb.org/t/p/w600_and_h900_face/8go3YE9sBMQaCXEx23j6BAfeuxd.jpg','https://youtube.com/watch? v=TcMBFSGVi1c',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08'),(2,'Kỵ Sĩ Bóng Đêm (The Dark Knight)','Khi một mối đe dọa được biết đến với cái tên Joker gây ra sự tàn phá và hỗn loạn cho người dân Gotham, Batman phải chấp nhận một trong những thử thách tâm lý và thể chất lớn nhất để chống lại sự bất công.  Bộ phim khám phá ranh giới mỏng manh giữa anh hùng và kẻ thù, giữa trật tự và hỗn loạn.',152,'C16','Tiếng Anh','Phụ đề Tiếng Việt','Warner Bros.  Pictures','2025-11-25','2026-01-25','NOW_SHOWING','https://www.themoviedb.org/t/p/w600_and_h900_face/7EfSqviKvXwbiGhUjHyUBGVdoiW.jpg','https://youtube.com/watch?v=EXeTwQWrcwY',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08'),(3,'Nhà Tù Shawshank (The Shawshank Redemption)','Andy Dufresne, một chủ ngân hàng bị kết án tù chung thân vì tội giết vợ và người tình của cô, mặc dù anh khẳng định mình vô tội. Trong nhà tù Shawshank, anh kết bạn với Red, một tù nhân lâu năm, và cùng nhau họ tìm thấy sự cứu rỗi thông qua sự tử tế và hy vọng.  Một câu chuyện về tình bạn, hy vọng và sức mạnh của tinh thần con người.',142,'C16','Tiếng Anh','Phụ đề Tiếng Việt','Castle Rock Entertainment','2025-11-28','2026-01-28','NOW_SHOWING','https://www.themoviedb.org/t/p/w600_and_h900_face/zLyG4nquaaZKCA3CJdQCEzTwN1R.jpg','https://youtube. com/watch?v=6hB3S9bIaco',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08'),(4,'Vua Sư Tử (The Lion King)','Simba, một chú sư tử con, sẽ kế vị cha mình Mufasa làm Vua của Pride Lands. Tuy nhiên, sau khi cha bị giết hại bởi chú của mình là Scar, Simba bị lừa dối và phải lưu vong.  Trưởng thành cùng hai người bạn mới Timon và Pumbaa, Simba phải tìm lại bản thân và đối mặt với quá khứ để giành lại ngai vàng. Kiệt tác hoạt hình vượt thời gian của Disney.',88,'P','Tiếng Anh','Lồng tiếng Việt','Walt Disney Pictures','2025-12-01','2026-02-01','NOW_SHOWING','https://www.themoviedb.org/t/p/w600_and_h900_face/AsGpIREstvwExc3UqczmIPP4pay.jpg','https://youtube.com/watch?v=4sj1MT05lAA',NULL,'2025-12-09 09:11:14','2025-12-17 23:22:17'),(5,'Coco: Hội Ngộ Diệu Kỳ','Miguel, một cậu bé 12 tuổi đam mê âm nhạc, bị gia đình cấm đoán theo đuổi giấc mơ ca hát. Trong ngày Lễ Người Chết, cậu vô tình bước vào Thế giới Người Chết và gặp gỡ các thành viên đã khuất trong gia đình.  Cùng với một bộ xương tên Héctor, Miguel phải khám phá bí mật gia đình và tìm đường trở về thế giới người sống trước bình minh.',105,'P','Tiếng Anh','Lồng tiếng Việt','Pixar Animation Studios','2025-12-03','2026-02-03','NOW_SHOWING','https://image.tmdb.org/t/p/original/tKd5zI6gLBwrqqyicHyRD3IyosW.jpg','https://youtube.com/watch?v=Rvr68u6k5sI',NULL,'2025-12-09 09:11:14','2025-12-12 01:23:54'),(6,'Bố Già (The Godfather)','Bộ phim kể về gia đình tội phạm Corleone dưới sự lãnh đạo của Don Vito Corleone, được biết đến với biệt danh \"Bố Già\". Khi ông từ chối tham gia vào hoạt động buôn bán ma túy với các gia đình mafia khác, một cuộc chiến tranh băng đảng nổ ra.  Con trai út Michael, ban đầu muốn tránh xa gia nghiệp, cuối cùng phải tiếp quản đế chế tội phạm của gia đình.',175,'C18','Tiếng Anh','Phụ đề Tiếng Việt','Paramount Pictures','2025-12-15','2026-02-15','COMING_SOON','https://www.themoviedb.org/t/p/w600_and_h900_face/84MHN3JvOV4ORHgELrQM6SBlhdB.jpg','https://youtube.com/watch? v=sY1S34973zA',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08'),(7,'Chúa Tể Của Những Chiếc Nhẫn: Sự Quay Trở Lại Của Nhà Vua (The Lord of the Rings: The Return of the King)','Phần cuối cùng của bộ ba sử thi.  Frodo và Sam tiếp tục hành trình đến Mordor để tiêu hủy Chiếc Nhẫn Quyền Lực, trong khi Aragorn phải chấp nhận số phận của mình để lãnh đạo Người trong trận chiến cuối cùng chống lại Sauron. Cuộc đối đầu định mệnh tại Cổng Đen sẽ quyết định số phận của Trung Địa.',201,'C13','Tiếng Anh','Phụ đề Tiếng Việt','New Line Cinema','2025-12-20','2026-02-28','COMING_SOON','https://www.themoviedb.org/t/p/w600_and_h900_face/3Y6eymGHCfQkDKU6rev2WiqXMci.jpg','https://youtube. com/watch?v=r5X-hFf6Bwo',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08'),(8,'Ma Trận (The Matrix)','Thomas Anderson, một lập trình viên ban ngày và hacker ban đêm với biệt danh Neo, phát hiện ra thế giới mà anh đang sống thực chất là một mô phỏng máy tính được gọi là Ma Trận.  Được Morpheus giải phóng, Neo phải đối mặt với sự thật khắc nghiệt và học cách chiến đấu để giải phóng nhân loại khỏi sự kiểm soát của máy móc.',136,'C16','Tiếng Anh','Phụ đề Tiếng Việt','Warner Bros. Pictures','2025-12-22','2026-02-22','COMING_SOON','https://www.themoviedb.org/t/p/w600_and_h900_face/fE7S6EwaBgRQeqKoDVFoImMmAF4.jpg','https://youtube.com/watch?v=vKQi3bBA1y8',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08'),(9,'Những Kẻ Bên Lề (Goodfellas)','Dựa trên câu chuyện có thật của Henry Hill, bộ phim kể về cuộc đời của một cậu bé Brooklyn từ nhỏ đã mơ ước trở thành gangster. Từ những ngày đầu làm việc cho gia đình mafia Lucchese, đến đỉnh cao quyền lực và sự sụp đổ không thể tránh khỏi.  Một tác phẩm kinh điển về thế giới ngầm của Martin Scorsese.',146,'C18','Tiếng Anh','Phụ đề Tiếng Việt','Warner Bros. Pictures','2025-12-25','2026-02-25','COMING_SOON','https://www.themoviedb.org/t/p/w600_and_h900_face/xSFPmpHEezDZjoc1pr7TUEerIr.jpg','https://youtube.com/watch?v=qo5jJpHtI1Y',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08'),(10,'Your Name (Kimi no Na wa)','Mitsuha, một nữ sinh trung học sống ở vùng nông thôn, mơ ước được sống ở Tokyo. Taki, một nam sinh Tokyo, sống cuộc sống bận rộn của thành phố. Một ngày nọ, họ bắt đầu hoán đổi thân xác khi ngủ.  Khi cố gắng tìm kiếm nhau trong thế giới thực, họ phát hiện ra một bí mật chấn động có thể thay đổi vận mệnh của cả hai.  Một câu chuyện tình yêu xuyên không gian và thời gian.',106,'P','Tiếng Nhật','Phụ đề Tiếng Việt','CoMix Wave Films','2025-12-28','2026-02-28','COMING_SOON','https://www.themoviedb.org/t/p/w600_and_h900_face/yV8ARrvpWaWd509QM4LwMScNDvZ.jpg','https://youtube.com/watch? v=xU47nhruN-Q',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08'),(11,'Avengers: Cuộc Chiến Vô Cực (Avengers: Infinity War)','Các Avengers và đồng minh của họ phải sẵn sàng hy sinh tất cả để ngăn chặn Thanos, kẻ hủy diệt vũ trụ quyền năng nhất, trước khi hắn có thể thu thập đủ sáu Viên đá Vô cực và sử dụng chúng để xóa sổ một nửa sự sống trong vũ trụ. Cuộc chiến khốc liệt nhất trong lịch sử MCU bắt đầu.',149,'C13','Tiếng Anh','Phụ đề Tiếng Việt','Marvel Studios','2025-12-30','2026-03-01','COMING_SOON','https://www.themoviedb.org/t/p/w600_and_h900_face/8gHc1cthgTOkmMiOREodCVZgJ7P.jpg','https://youtube.com/watch? v=6ZfuNTqbHE8',NULL,'2025-12-09 09:11:14','2025-12-17 23:28:08');
